import axios from "axios";

export const fetchData = (param) => {
  return axios.get(
    `https://api.themoviedb.org/3/discover/tv?api_key=28c5a5bb5ae830823097ffb31f8a685e`,
    {
      params: {
        append_to_response: "videos",
      },
    }
  );
};
